                                                            <blockquote class="flex-grow text-md">I have been converting
                                                                bw classphotos to color and found palette.fm to do an
                                                                excellent job.

                                                                In PhotoShop or Pixlr set AutoLevel which increases
                                                                contrast and erase, clone any issues with photo. There
                                                                are other tools for restoring old photos that you may
                                                                need to use before colorizing. The Palette.FM Base
                                                                Palette caused skin to be discolored. Selecting Royal
                                                                Vibes gave better colors, but changing the Edit Prompt
                                                                to "royal colors, skin tones" I was able to get more
                                                                natural skin tone. I then used CodeFormer to upscale 4x
