                                                            <blockquote class="flex-grow text-md">KI ist DAS große
                                                                Thema! Unbekanntes macht einem erst einmal ein bißchen
                                                                Sorgen. Überrascht hat mich das Programm aber sehr
                                                                (positiv).
                                                                Mit am besten hat mir die intuitive Handhabung gefallen,
                                                                die vielen (21!) voreingestellten Bilddarstellungen
                                                                haben mich mehr als positiv überzeugt, daß KI, zumindest
                                                                bei der Kolorierung alter Photos sehr nützlich sein
                                                                kann.
                                                                Aber man sollte wissen, daß zum Beispiel Uniformen des
                                                                Heeres (grau) ohne weiteres, als Uniform erkannt, als
                                                                blau (der Fliegerei) wiedergegeben werden kann.
                                                                Kleine Fehler (zum Beispiel unterschiedlich farbige
                                                                Schuhe von einer Person; oder das eine Schienbein nackt
                                                                das andere mit einem Strumpf (siehe Photo), oder aber
                                                                Uniformjacke hat eine andere Farbe als die dazugehörige
                                                                Hose) werden sicherlich bald korrigiert werden.
                                                                Zum Schluß: mich hat das Programm (auf meinem PC)
                                                                begeistert.
                                                                Großes kommt auf uns zu... hoffentlich mit klaren
                                                                Regeln.
