                                                            <blockquote class="flex-grow text-md">I've been restoring
                                                                old family photos for several years and have used
                                                                multiple products in an attempt to shorten the time
                                                                required to produce a high quality colorization. Palette
                                                                is the only option that I've used that delivers
                                                                relatively accurate skin tones without blowing out the
                                                                highlight areas in faces. Combined with the multiple
                                                                templates and ability to modify the prompts, I'm
                                                                typically able to cut the subsequent time spent in
                                                                Photoshop substantially. Really looking forward to what
                                                                Palette will be able to deliver in the future!
                                                            </blockquote>
